import React from 'react';

const Spinner = ({message}) => {
    return (
        <div className="mt-5">
            <div className="fontify display-3 text-center mt-4">{message || Loading}</div>
            <div className="ui  large  active centered inline loader"/>
        </div>
    );
};

export default Spinner;
